static char __pyx_k_iv_v_z_Modified_Bessel_function[] = "iv(v, z)\n\nModified Bessel function of the first kind of real order.\n\nParameters\n----------\nv : array_like\n    Order. If `z` is of real type and negative, `v` must be integer\n    valued.\nz : array_like of float or complex\n    Argument.\n\nReturns\n-------\nout : ndarray\n    Values of the modified Bessel function.\n\nNotes\n-----\nFor real `z` and :math:`v \\in [-50, 50]`, the evaluation is carried out\nusing Temme's method [1]_.  For larger orders, uniform asymptotic\nexpansions are applied.\n\nFor complex `z` and positive `v`, the AMOS [2]_ `zbesi` routine is\ncalled. It uses a power series for small `z`, the asymptitic expansion\nfor large `abs(z)`, the Miller algorithm normalized by the Wronskian\nand a Neumann series for intermediate magnitudes, and the uniform\nasymptitic expansions for :math:`I_v(z)` and :math:`J_v(z)` for large\norders.  Backward recurrence is used to generate sequences or reduce\norders when necessary.\n\nThe calculations above are done in the right half plane and continued\ninto the left half plane by the formula,\n\n.. math:: I_v(z \\exp(\\pm\\imath\\pi)) = \\exp(\\pm\\pi v) I_v(z)\n\n(valid when the real part of `z` is positive).  For negative `v`, the\nformula\n\n.. math:: I_{-v}(z) = I_v(z) + \\frac{2}{\\pi} \\sin(\\pi v) K_v(z)\n\nis used, where :math:`K_v(z)` is the modified Bessel function of the\nsecond kind, evaluated using the AMOS routine `zbesk`.\n\nSee also\n--------\nkve : This function with leading exponential behavior stripped off.\n\nReferences\n----------\n.. [1] Temme, Journal of Computational Physics, vol 21, 343 (1976)\n.. [2] Donald E. Amos, \"AMOS, A Portable Package for Bessel Functions\n       of a Complex Argument and Nonnegative Order\",\n       http://netlib.org/amos/";
static char __pyx_k_keip_x_Derivative_of_the_Kelvin[] = "keip(x)\n\nDerivative of the Kelvin function kei";
static char __pyx_k_kerp_x_Derivative_of_the_Kelvin[] = "kerp(x)\n\nDerivative of the Kelvin function ker";
static char __pyx_k_kl_div_x_y_Elementwise_function[] = "kl_div(x, y)\n\nElementwise function for computing Kullback-Leibler divergence.\n\n.. math:: \\mathrm{kl\\_div}(x, y) = \\begin{cases} x \\log(x / y) - x + y & x > 0, y > 0 \\\\ y & x = 0, y \\ge 0 \\\\ \\infty & \\text{otherwise} \\end{cases}\n\nParameters\n----------\nx : ndarray\n    First input array.\ny : ndarray\n    Second input array.\n\nReturns\n-------\nres : ndarray\n    Output array.\n\nSee Also\n--------\nentr, rel_entr\n\nNotes\n-----\nThis function is non-negative and is jointly convex in `x` and `y`.\n\n.. versionadded:: 0.15.0";
static char __pyx_k_kn_n_x_Modified_Bessel_function[] = "kn(n, x)\n\nModified Bessel function of the second kind of integer order `n`\n\nReturns the modified Bessel function of the second kind for integer order\n`n` at real `z`.\n\nThese are also sometimes called functions of the third kind, Basset\nfunctions, or Macdonald functions.\n\nParameters\n----------\nn : array_like of int\n    Order of Bessel functions (floats will truncate with a warning)\nz : array_like of float\n    Argument at which to evaluate the Bessel functions\n\nReturns\n-------\nout : ndarray\n    The results\n\nNotes\n-----\nWrapper for AMOS [1]_ routine `zbesk`.  For a discussion of the\nalgorithm used, see [2]_ and the references therein.\n\nSee Also\n--------\nkv : Same function, but accepts real order and complex argument\nkvp : Derivative of this function\n\nReferences\n----------\n.. [1] Donald E. Amos, \"AMOS, A Portable Package for Bessel Functions\n       of a Complex Argument and Nonnegative Order\",\n       http://netlib.org/amos/\n.. [2] Donald E. Amos, \"Algorithm 644: A portable package for Bessel\n       functions of a complex argument and nonnegative order\", ACM\n       TOMS Vol. 12 Issue 3, Sept. 1986, p. 265\n\nExamples\n--------\nPlot the function of several orders for real input:\n\n>>> from scipy.special import kn\n>>> import matplotlib.pyplot as plt\n>>> x = np.linspace(0, 5, 1000)\n>>> for N in range(6):\n...     plt.plot(x, kn(N, x), label='$K_{}(x)$'.format(N))\n>>> plt.ylim(0, 10)\n>>> plt.legend()\n>>> plt.title(r'Modified Bessel function of the second kind $K_n(x)$')\n>>> plt.show()\n\nCalculate for a single value at multiple orders:\n\n>>> kn([4, 5, 6], 1)\narray([   44.23241585,   360.9605896 ,  3653.83831186])";
static char __pyx_k_kv_v_z_Modified_Bessel_function[] = "kv(v, z)\n\nModified Bessel function of the second kind of real order `v`\n\nReturns the modified Bessel function of the second kind for real order\n`v` at complex `z`.\n\nThese are also sometimes called functions of the third kind, Basset\nfunctions, or Macdonald functions.  They are defined as those solutions\nof the modified Bessel equation for which,\n\n.. math::\n    K_v(x) \\sim \\sqrt{\\pi/(2x)} \\exp(-x)\n\nas :math:`x \\to \\infty` [3]_.\n\nParameters\n----------\nv : array_like of float\n    Order of Bessel functions\nz : array_like of complex\n    Argument at which to evaluate the Bessel functions\n\nReturns\n-------\nout : ndarray\n    The results. Note that input must be of complex type to get complex\n    output, e.g. ``kv(3, -2+0j)`` instead of ``kv(3, -2)``.\n\nNotes\n-----\nWrapper for AMOS [1]_ routine `zbesk`.  For a discussion of the\nalgorithm used, see [2]_ and the references therein.\n\nSee Also\n--------\nkve : This function with leading exponential behavior stripped off.\nkvp : Derivative of this function\n\nReferences\n----------\n.. [1] Donald E. Amos, \"AMOS, A Portable Package for Bessel Functions\n       of a Complex Argument and Nonnegative Order\",\n       http://netlib.org/amos/\n.. [2] Donald E. Amos, \"Algorithm 644: A portable package for Bessel\n       functions of a complex argument and nonnegative order\", ACM\n       TOMS Vol. 12 Issue 3, Sept. 1986, p. 265\n.. [3] NIST Digital Library of Mathematical Functions,\n       Eq. 10.25.E3. http://dlmf.nist.gov/10.25.E3\n\nExamples\n--------\nPlot the function of several orders for real input:\n\n>>> from scipy.special import kv\n>>> import matplotlib.pyplot as plt\n>>> x = np.linspace(0, 5, 1000)\n>>> for N in np.linspace(0, 6, 5):\n...     plt.plot(x, kv(N, x), label='$K_{{{}}}(x)$'.format(N))\n>>> plt.ylim(0, 10)\n>>> plt.legend()\n>>> plt.title(r'Modified Bessel function of the second kind $K_\\nu(x)$')\n>>> plt.show()\n\nCalculate for a single value at multiple orders:\n\n>>> kv""([4, 4.5, 5], 1+2j)\narray([ 0.1992+2.3892j,  2.3493+3.6j   ,  7.2827+3.8104j])";
static char __pyx_k_ncfdtridfd_p_f_dfn_nc_Calculate[] = "ncfdtridfd(p, f, dfn, nc)\n\nCalculate degrees of freedom (denominator) for the noncentral F-distribution.\n\nSee `ncfdtr` for more details.\n\nNotes\n-----\nThe value of the cumulative noncentral F distribution is not necessarily\nmonotone in either degrees of freedom.  There thus may be two values that\nprovide a given CDF value.  This routine assumes monotonicity and will\nfind an arbitrary one of the two values.";
static char __pyx_k_ncfdtridfn_p_f_dfd_nc_Calculate[] = "ncfdtridfn(p, f, dfd, nc)\n\nCalculate degrees of freedom (numerator) for the noncentral F-distribution.\n\nSee `ncfdtr` for more details.\n\nNotes\n-----\nThe value of the cumulative noncentral F distribution is not necessarily\nmonotone in either degrees of freedom.  There thus may be two values that\nprovide a given CDF value.  This routine assumes monotonicity and will\nfind an arbitrary one of the two values.";
static char __pyx_k_ncfdtrinc_p_f_dfn_dfd_Calculate[] = "ncfdtrinc(p, f, dfn, dfd)\n\nCalculate non-centrality parameter for non-central F distribution.\n\nSee `ncfdtr` for more details.";
static char __pyx_k_nrdtrimn_p_x_std_Calculate_mean[] = "nrdtrimn(p, x, std)\n\nCalculate mean of normal distribution given other params.\n\nParameters\n----------\np : array_like\n    CDF values, in range (0, 1].\nx : array_like\n    Quantiles, i.e. the upper limit of integration.\nstd : array_like\n    Standard deviation.\n\nReturns\n-------\nmn : float or ndarray\n    The mean of the normal distribution.\n\nSee Also\n--------\nnrdtrimn, ndtr";
static char __pyx_k_pdtrik_p_m_Inverse_to_pdtr_vs_k[] = "pdtrik(p, m)\n\nInverse to `pdtr` vs k\n\nReturns the quantile k such that ``pdtr(k, m) = p``";
static char __pyx_k_smirnovi_n_y_Inverse_to_smirnov[] = "smirnovi(n, y)\n\nInverse to `smirnov`\n\nReturns ``e`` such that ``smirnov(n, e) = y``.";
static char __pyx_k_spence_z_Spence_s_function_also[] = "spence(z)\n\nSpence's function, also known as the dilogarithm. It is defined to\nbe\n\n.. math::\n  \\int_0^z \\frac{\\log(t)}{1 - t}dt\n\nfor complex :math:`z`, where the contour of integration is taken\nto avoid the branch cut of the logarithm. Spence's function is\nanalytic everywhere except the negative real axis where it has a\nbranch cut.\n\nNote that there is a different convention which defines Spence's\nfunction by the integral\n\n.. math::\n  -\\int_0^z \\frac{\\log(1 - t)}{t}dt;\n\nthis is our ``spence(1 - z)``.";
static char __pyx_k_struve_asymp_large_z_v_z_is_h_I[] = "_struve_asymp_large_z(v, z, is_h)\n\nInternal function for testing `struve` & `modstruve`\n\nEvaluates using asymptotic expansion\n\nReturns\n-------\nv, err";
