static char __pyx_k_expit_x_Expit_ufunc_for_ndarrays[] = "expit(x)\n\nExpit ufunc for ndarrays.\n\nThe expit function, also known as the logistic function, is defined as\nexpit(x) = 1/(1+exp(-x)). It is the inverse of the logit function.\n\nParameters\n----------\nx : ndarray\n    The ndarray to apply expit to element-wise.\n\nReturns\n-------\nout : ndarray\n    An ndarray of the same shape as x. Its entries\n    are expit of the corresponding entry of x.\n\nNotes\n-----\nAs a ufunc expit takes a number of optional\nkeyword arguments. For more information\nsee `ufuncs <https://docs.scipy.org/doc/numpy/reference/ufuncs.html>`_\n\n.. versionadded:: 0.10.0";
static char __pyx_k_expm1_x_exp_x_1_for_use_when_x_i[] = "expm1(x)\n\nexp(x) - 1 for use when `x` is near zero.";
static char __pyx_k_exprel_x_Relative_error_exponent[] = "exprel(x)\n\nRelative error exponential, (exp(x)-1)/x, for use when `x` is near zero.\n\nParameters\n----------\nx : ndarray\n    Input array.\n\nReturns\n-------\nres : ndarray\n    Output array.\n\nSee Also\n--------\nexpm1\n\n.. versionadded:: 0.17.0";
static char __pyx_k_fdtr_dfn_dfd_x_F_cumulative_dist[] = "fdtr(dfn, dfd, x)\n\nF cumulative distribution function.\n\nReturns the value of the cumulative density function of the\nF-distribution, also known as Snedecor's F-distribution or the\nFisher-Snedecor distribution.\n\nThe F-distribution with parameters :math:`d_n` and :math:`d_d` is the\ndistribution of the random variable,\n\n.. math::\n    X = \\frac{U_n/d_n}{U_d/d_d},\n\nwhere :math:`U_n` and :math:`U_d` are random variables distributed\n:math:`\\chi^2`, with :math:`d_n` and :math:`d_d` degrees of freedom,\nrespectively.\n\nParameters\n----------\ndfn : array_like\n    First parameter (positive float).\ndfd : array_like\n    Second parameter (positive float).\nx : array_like\n    Argument (nonnegative float).\n\nReturns\n-------\ny : ndarray\n    The CDF of the F-distribution with parameters `dfn` and `dfd` at `x`.\n\nNotes\n-----\nThe regularized incomplete beta function is used, according to the\nformula,\n\n.. math::\n    F(d_n, d_d; x) = I_{xd_n/(d_d + xd_n)}(d_n/2, d_d/2).\n\nWrapper for the Cephes [1]_ routine `fdtr`.\n\nReferences\n----------\n.. [1] Cephes Mathematical Functions Library,\n       http://www.netlib.org/cephes/index.html";
static char __pyx_k_fdtrc_dfn_dfd_x_F_survival_funct[] = "fdtrc(dfn, dfd, x)\n\nF survival function.\n\nReturns the complemented F-distribution function (the integral of the\ndensity from `x` to infinity).\n\nParameters\n----------\ndfn : array_like\n    First parameter (positive float).\ndfd : array_like\n    Second parameter (positive float).\nx : array_like\n    Argument (nonnegative float).\n\nReturns\n-------\ny : ndarray\n    The complemented F-distribution function with parameters `dfn` and\n    `dfd` at `x`.\n\nSee also\n--------\nfdtr\n\nNotes\n-----\nThe regularized incomplete beta function is used, according to the\nformula,\n\n.. math::\n    F(d_n, d_d; x) = I_{d_d/(d_d + xd_n)}(d_d/2, d_n/2).\n\nWrapper for the Cephes [1]_ routine `fdtrc`.\n\nReferences\n----------\n.. [1] Cephes Mathematical Functions Library,\n       http://www.netlib.org/cephes/index.html";
static char __pyx_k_fdtri_dfn_dfd_p_The_p_th_quantil[] = "fdtri(dfn, dfd, p)\n\nThe `p`-th quantile of the F-distribution.\n\nThis function is the inverse of the F-distribution CDF, `fdtr`, returning\nthe `x` such that `fdtr(dfn, dfd, x) = p`.\n\nParameters\n----------\ndfn : array_like\n    First parameter (positive float).\ndfd : array_like\n    Second parameter (positive float).\np : array_like\n    Cumulative probability, in [0, 1].\n\nReturns\n-------\nx : ndarray\n    The quantile corresponding to `p`.\n\nNotes\n-----\nThe computation is carried out using the relation to the inverse\nregularized beta function, :math:`I^{-1}_x(a, b)`.  Let\n:math:`z = I^{-1}_p(d_d/2, d_n/2).`  Then,\n\n.. math::\n    x = \\frac{d_d (1 - z)}{d_n z}.\n\nIf `p` is such that :math:`x < 0.5`, the following relation is used\ninstead for improved stability: let\n:math:`z' = I^{-1}_{1 - p}(d_n/2, d_d/2).` Then,\n\n.. math::\n    x = \\frac{d_d z'}{d_n (1 - z')}.\n\nWrapper for the Cephes [1]_ routine `fdtri`.\n\nReferences\n----------\n.. [1] Cephes Mathematical Functions Library,\n       http://www.netlib.org/cephes/index.html";
static char __pyx_k_fdtridfd_dfn_p_x_Inverse_to_fdtr[] = "fdtridfd(dfn, p, x)\n\nInverse to `fdtr` vs dfd\n\nFinds the F density argument dfd such that ``fdtr(dfn, dfd, x) == p``.";
static char __pyx_k_fresnel_z_Fresnel_sin_and_cos_in[] = "fresnel(z)\n\nFresnel sin and cos integrals\n\nDefined as::\n\n    ssa = integral(sin(pi/2 * t**2), t=0..z)\n    csa = integral(cos(pi/2 * t**2), t=0..z)\n\nParameters\n----------\nz : float or complex array_like\n    Argument\n\nReturns\n-------\nssa, csa\n    Fresnel sin and cos integral values";
static char __pyx_k_gamma_z_Gamma_function_The_gamma[] = "gamma(z)\n\nGamma function.\n\nThe gamma function is often referred to as the generalized\nfactorial since ``z*gamma(z) = gamma(z+1)`` and ``gamma(n+1) =\nn!`` for natural number *n*.";
static char __pyx_k_gammainc_a_x_Incomplete_gamma_fu[] = "gammainc(a, x)\n\nIncomplete gamma function\n\nDefined as::\n\n    1 / gamma(a) * integral(exp(-t) * t**(a-1), t=0..x)\n\n`a` must be positive and `x` must be >= 0.";
static char __pyx_k_gammaincc_a_x_Complemented_incom[] = "gammaincc(a, x)\n\nComplemented incomplete gamma integral\n\nDefined as::\n\n    1 / gamma(a) * integral(exp(-t) * t**(a-1), t=x..inf) = 1 - gammainc(a, x)\n\n`a` must be positive and `x` must be >= 0.";
static char __pyx_k_gammainccinv_a_y_Inverse_to_gamm[] = "gammainccinv(a, y)\n\nInverse to `gammaincc`\n\nReturns `x` such that ``gammaincc(a, x) == y``.";
static char __pyx_k_gammaincinv_a_y_Inverse_to_gamma[] = "gammaincinv(a, y)\n\nInverse to `gammainc`\n\nReturns `x` such that ``gammainc(a, x) = y``.";
static char __pyx_k_gammasgn_x_Sign_of_the_gamma_fun[] = "gammasgn(x)\n\nSign of the gamma function.\n\nSee Also\n--------\ngammaln\nloggamma";
static char __pyx_k_gdtr_a_b_x_Gamma_distribution_cu[] = "gdtr(a, b, x)\n\nGamma distribution cumulative density function.\n\nReturns the integral from zero to `x` of the gamma probability density\nfunction,\n\n.. math::\n\n    F = \\int_0^x \\frac{a^b}{\\Gamma(b)} t^{b-1} e^{-at}\\,dt,\n\nwhere :math:`\\Gamma` is the gamma function.\n\nParameters\n----------\na : array_like\n    The rate parameter of the gamma distribution, sometimes denoted\n    :math:`\\beta` (float).  It is also the reciprocal of the scale\n    parameter :math:`\\theta`.\nb : array_like\n    The shape parameter of the gamma distribution, sometimes denoted\n    :math:`\\alpha` (float).\nx : array_like\n    The quantile (upper limit of integration; float).\n\nSee also\n--------\ngdtrc : 1 - CDF of the gamma distribution.\n\nReturns\n-------\nF : ndarray\n    The CDF of the gamma distribution with parameters `a` and `b`\n    evaluated at `x`.\n\nNotes\n-----\nThe evaluation is carried out using the relation to the incomplete gamma\nintegral (regularized gamma function).\n\nWrapper for the Cephes [1]_ routine `gdtr`.\n\nReferences\n----------\n.. [1] Cephes Mathematical Functions Library,\n       http://www.netlib.org/cephes/index.html";
static char __pyx_k_gdtrc_a_b_x_Gamma_distribution_s[] = "gdtrc(a, b, x)\n\nGamma distribution survival function.\n\nIntegral from `x` to infinity of the gamma probability density function,\n\n.. math::\n\n    F = \\int_x^\\infty \\frac{a^b}{\\Gamma(b)} t^{b-1} e^{-at}\\,dt,\n\nwhere :math:`\\Gamma` is the gamma function.\n\nParameters\n----------\na : array_like\n    The rate parameter of the gamma distribution, sometimes denoted\n    :math:`\\beta` (float).  It is also the reciprocal of the scale\n    parameter :math:`\\theta`.\nb : array_like\n    The shape parameter of the gamma distribution, sometimes denoted\n    :math:`\\alpha` (float).\nx : array_like\n    The quantile (lower limit of integration; float).\n\nReturns\n-------\nF : ndarray\n    The survival function of the gamma distribution with parameters `a`\n    and `b` evaluated at `x`.\n\nSee Also\n--------\ngdtr, gdtri\n\nNotes\n-----\nThe evaluation is carried out using the relation to the incomplete gamma\nintegral (regularized gamma function).\n\nWrapper for the Cephes [1]_ routine `gdtrc`.\n\nReferences\n----------\n.. [1] Cephes Mathematical Functions Library,\n       http://www.netlib.org/cephes/index.html";
static char __pyx_k_gdtria_p_b_x_out_None_Inverse_of[] = "gdtria(p, b, x, out=None)\n\nInverse of `gdtr` vs a.\n\nReturns the inverse with respect to the parameter `a` of ``p =\ngdtr(a, b, x)``, the cumulative distribution function of the gamma\ndistribution.\n\nParameters\n----------\np : array_like\n    Probability values.\nb : array_like\n    `b` parameter values of `gdtr(a, b, x)`.  `b` is the \"shape\" parameter\n    of the gamma distribution.\nx : array_like\n    Nonnegative real values, from the domain of the gamma distribution.\nout : ndarray, optional\n    If a fourth argument is given, it must be a numpy.ndarray whose size\n    matches the broadcast result of `a`, `b` and `x`.  `out` is then the\n    array returned by the function.\n\nReturns\n-------\na : ndarray\n    Values of the `a` parameter such that `p = gdtr(a, b, x)`.  `1/a`\n    is the \"scale\" parameter of the gamma distribution.\n\nSee Also\n--------\ngdtr : CDF of the gamma distribution.\ngdtrib : Inverse with respect to `b` of `gdtr(a, b, x)`.\ngdtrix : Inverse with respect to `x` of `gdtr(a, b, x)`.\n\nNotes\n-----\nWrapper for the CDFLIB [1]_ Fortran routine `cdfgam`.\n\nThe cumulative distribution function `p` is computed using a routine by\nDiDinato and Morris [2]_.  Computation of `a` involves a seach for a value\nthat produces the desired value of `p`.  The search relies on the\nmonotinicity of `p` with `a`.\n\nReferences\n----------\n.. [1] Barry Brown, James Lovato, and Kathy Russell,\n       CDFLIB: Library of Fortran Routines for Cumulative Distribution\n       Functions, Inverses, and Other Parameters.\n.. [2] DiDinato, A. R. and Morris, A. H.,\n       Computation of the incomplete gamma function ratios and their\n       inverse.  ACM Trans. Math. Softw. 12 (1986), 377-393.\n\nExamples\n--------\nFirst evaluate `gdtr`.\n\n>>> from scipy.special import gdtr, gdtria\n>>> p = gdtr(1.2, 3.4, 5.6)\n>>> print(p)\n0.94378087442\n\nVerify the inverse.\n\n>>> gdtria(p, 3.4, 5.6)\n1.2";
static char __pyx_k_gdtrib_a_p_x_out_None_Inverse_of[] = "gdtrib(a, p, x, out=None)\n\nInverse of `gdtr` vs b.\n\nReturns the inverse with respect to the parameter `b` of ``p =\ngdtr(a, b, x)``, the cumulative distribution function of the gamma\ndistribution.\n\nParameters\n----------\na : array_like\n    `a` parameter values of `gdtr(a, b, x)`. `1/a` is the \"scale\"\n    parameter of the gamma distribution.\np : array_like\n    Probability values.\nx : array_like\n    Nonnegative real values, from the domain of the gamma distribution.\nout : ndarray, optional\n    If a fourth argument is given, it must be a numpy.ndarray whose size\n    matches the broadcast result of `a`, `b` and `x`.  `out` is then the\n    array returned by the function.\n\nReturns\n-------\nb : ndarray\n    Values of the `b` parameter such that `p = gdtr(a, b, x)`.  `b` is\n    the \"shape\" parameter of the gamma distribution.\n\nSee Also\n--------\ngdtr : CDF of the gamma distribution.\ngdtria : Inverse with respect to `a` of `gdtr(a, b, x)`.\ngdtrix : Inverse with respect to `x` of `gdtr(a, b, x)`.\n\nNotes\n-----\nWrapper for the CDFLIB [1]_ Fortran routine `cdfgam`.\n\nThe cumulative distribution function `p` is computed using a routine by\nDiDinato and Morris [2]_.  Computation of `b` involves a seach for a value\nthat produces the desired value of `p`.  The search relies on the\nmonotinicity of `p` with `b`.\n\nReferences\n----------\n.. [1] Barry Brown, James Lovato, and Kathy Russell,\n       CDFLIB: Library of Fortran Routines for Cumulative Distribution\n       Functions, Inverses, and Other Parameters.\n.. [2] DiDinato, A. R. and Morris, A. H.,\n       Computation of the incomplete gamma function ratios and their\n       inverse.  ACM Trans. Math. Softw. 12 (1986), 377-393.\n\nExamples\n--------\nFirst evaluate `gdtr`.\n\n>>> from scipy.special import gdtr, gdtrib\n>>> p = gdtr(1.2, 3.4, 5.6)\n>>> print(p)\n0.94378087442\n\nVerify the inverse.\n\n>>> gdtrib(1.2, p, 5.6)\n3.3999999999723882";
static char __pyx_k_gdtrix_a_b_p_out_None_Inverse_of[] = "gdtrix(a, b, p, out=None)\n\nInverse of `gdtr` vs x.\n\nReturns the inverse with respect to the parameter `x` of ``p =\ngdtr(a, b, x)``, the cumulative distribution function of the gamma\ndistribution. This is also known as the p'th quantile of the\ndistribution.\n\nParameters\n----------\na : array_like\n    `a` parameter values of `gdtr(a, b, x)`.  `1/a` is the \"scale\"\n    parameter of the gamma distribution.\nb : array_like\n    `b` parameter values of `gdtr(a, b, x)`.  `b` is the \"shape\" parameter\n    of the gamma distribution.\np : array_like\n    Probability values.\nout : ndarray, optional\n    If a fourth argument is given, it must be a numpy.ndarray whose size\n    matches the broadcast result of `a`, `b` and `x`.  `out` is then the\n    array returned by the function.\n\nReturns\n-------\nx : ndarray\n    Values of the `x` parameter such that `p = gdtr(a, b, x)`.\n\nSee Also\n--------\ngdtr : CDF of the gamma distribution.\ngdtria : Inverse with respect to `a` of `gdtr(a, b, x)`.\ngdtrib : Inverse with respect to `b` of `gdtr(a, b, x)`.\n\nNotes\n-----\nWrapper for the CDFLIB [1]_ Fortran routine `cdfgam`.\n\nThe cumulative distribution function `p` is computed using a routine by\nDiDinato and Morris [2]_.  Computation of `x` involves a seach for a value\nthat produces the desired value of `p`.  The search relies on the\nmonotinicity of `p` with `x`.\n\nReferences\n----------\n.. [1] Barry Brown, James Lovato, and Kathy Russell,\n       CDFLIB: Library of Fortran Routines for Cumulative Distribution\n       Functions, Inverses, and Other Parameters.\n.. [2] DiDinato, A. R. and Morris, A. H.,\n       Computation of the incomplete gamma function ratios and their\n       inverse.  ACM Trans. Math. Softw. 12 (1986), 377-393.\n\nExamples\n--------\nFirst evaluate `gdtr`.\n\n>>> from scipy.special import gdtr, gdtrix\n>>> p = gdtr(1.2, 3.4, 5.6)\n>>> print(p)\n0.94378087442\n\nVerify the inverse.\n\n>>> gdtrix(1.2, 3.4, p)\n5.5999999999999996";
static char __pyx_k_hankel1_v_z_Hankel_function_of_t[] = "hankel1(v, z)\n\nHankel function of the first kind\n\nParameters\n----------\nv : array_like\n    Order (float).\nz : array_like\n    Argument (float or complex).\n\nReturns\n-------\nout : Values of the Hankel function of the first kind.\n\nNotes\n-----\nA wrapper for the AMOS [1]_ routine `zbesh`, which carries out the\ncomputation using the relation,\n\n.. math:: H^{(1)}_v(z) = \\frac{2}{\\imath\\pi} \\exp(-\\imath \\pi v/2) K_v(z \\exp(-\\imath\\pi/2))\n\nwhere :math:`K_v` is the modified Bessel function of the second kind.\nFor negative orders, the relation\n\n.. math:: H^{(1)}_{-v}(z) = H^{(1)}_v(z) \\exp(\\imath\\pi v)\n\nis used.\n\nSee also\n--------\nhankel1e : this function with leading exponential behavior stripped off.\n\nReferences\n----------\n.. [1] Donald E. Amos, \"AMOS, A Portable Package for Bessel Functions\n       of a Complex Argument and Nonnegative Order\",\n       http://netlib.org/amos/";
static char __pyx_k_hankel1e_v_z_Exponentially_scale[] = "hankel1e(v, z)\n\nExponentially scaled Hankel function of the first kind\n\nDefined as::\n\n    hankel1e(v, z) = hankel1(v, z) * exp(-1j * z)\n\nParameters\n----------\nv : array_like\n    Order (float).\nz : array_like\n    Argument (float or complex).\n\nReturns\n-------\nout : Values of the exponentially scaled Hankel function.\n\nNotes\n-----\nA wrapper for the AMOS [1]_ routine `zbesh`, which carries out the\ncomputation using the relation,\n\n.. math:: H^{(1)}_v(z) = \\frac{2}{\\imath\\pi} \\exp(-\\imath \\pi v/2) K_v(z \\exp(-\\imath\\pi/2))\n\nwhere :math:`K_v` is the modified Bessel function of the second kind.\nFor negative orders, the relation\n\n.. math:: H^{(1)}_{-v}(z) = H^{(1)}_v(z) \\exp(\\imath\\pi v)\n\nis used.\n\nReferences\n----------\n.. [1] Donald E. Amos, \"AMOS, A Portable Package for Bessel Functions\n       of a Complex Argument and Nonnegative Order\",\n       http://netlib.org/amos/";
static char __pyx_k_hankel2_v_z_Hankel_function_of_t[] = "hankel2(v, z)\n\nHankel function of the second kind\n\nParameters\n----------\nv : array_like\n    Order (float).\nz : array_like\n    Argument (float or complex).\n\nReturns\n-------\nout : Values of the Hankel function of the second kind.\n\nNotes\n-----\nA wrapper for the AMOS [1]_ routine `zbesh`, which carries out the\ncomputation using the relation,\n\n.. math:: H^{(2)}_v(z) = -\\frac{2}{\\imath\\pi} \\exp(\\imath \\pi v/2) K_v(z \\exp(\\imath\\pi/2))\n\nwhere :math:`K_v` is the modified Bessel function of the second kind.\nFor negative orders, the relation\n\n.. math:: H^{(2)}_{-v}(z) = H^{(2)}_v(z) \\exp(-\\imath\\pi v)\n\nis used.\n\nSee also\n--------\nhankel2e : this function with leading exponential behavior stripped off.\n\nReferences\n----------\n.. [1] Donald E. Amos, \"AMOS, A Portable Package for Bessel Functions\n       of a Complex Argument and Nonnegative Order\",\n       http://netlib.org/amos/";
static char __pyx_k_hankel2e_v_z_Exponentially_scale[] = "hankel2e(v, z)\n\nExponentially scaled Hankel function of the second kind\n\nDefined as::\n\n    hankel2e(v, z) = hankel2(v, z) * exp(1j * z)\n\nParameters\n----------\nv : array_like\n    Order (float).\nz : array_like\n    Argument (float or complex).\n\nReturns\n-------\nout : Values of the exponentially scaled Hankel function of the second kind.\n\nNotes\n-----\nA wrapper for the AMOS [1]_ routine `zbesh`, which carries out the\ncomputation using the relation,\n\n.. math:: H^{(2)}_v(z) = -\\frac{2}{\\imath\\pi} \\exp(\\frac{\\imath \\pi v}{2}) K_v(z exp(\\frac{\\imath\\pi}{2}))\n\nwhere :math:`K_v` is the modified Bessel function of the second kind.\nFor negative orders, the relation\n\n.. math:: H^{(2)}_{-v}(z) = H^{(2)}_v(z) \\exp(-\\imath\\pi v)\n\nis used.\n\nReferences\n----------\n.. [1] Donald E. Amos, \"AMOS, A Portable Package for Bessel Functions\n       of a Complex Argument and Nonnegative Order\",\n       http://netlib.org/amos/";
static char __pyx_k_huber_delta_r_Huber_loss_functio[] = "huber(delta, r)\n\nHuber loss function.\n\n.. math:: \\text{huber}(\\delta, r) = \\begin{cases} \\infty & \\delta < 0  \\\\ \\frac{1}{2}r^2 & 0 \\le \\delta, | r | \\le \\delta \\\\ \\delta ( |r| - \\frac{1}{2}\\delta ) & \\text{otherwise} \\end{cases}\n\nParameters\n----------\ndelta : ndarray\n    Input array, indicating the quadratic vs. linear loss changepoint.\nr : ndarray\n    Input array, possibly representing residuals.\n\nReturns\n-------\nres : ndarray\n    The computed Huber loss function values.\n\nNotes\n-----\nThis function is convex in r.\n\n.. versionadded:: 0.15.0";
static char __pyx_k_hyp0f1_v_x_Confluent_hypergeomet[] = "hyp0f1(v, x)\n\nConfluent hypergeometric limit function 0F1.\n\nParameters\n----------\nv, z : array_like\n    Input values.\n\nReturns\n-------\nhyp0f1 : ndarray\n    The confluent hypergeometric limit function.\n\nNotes\n-----\nThis function is defined as:\n\n.. math:: _0F_1(v, z) = \\sum_{k=0}^{\\infty}\\frac{z^k}{(v)_k k!}.\n\nIt's also the limit as :math:`q \\to \\infty` of :math:`_1F_1(q; v; z/q)`,\nand satisfies the differential equation :math:`f''(z) + vf'(z) = f(z)`.";
static char __pyx_k_hyp1f1_a_b_x_Confluent_hypergeom[] = "hyp1f1(a, b, x)\n\nConfluent hypergeometric function 1F1(a, b; x)";
static char __pyx_k_hyp1f2_a_b_c_x_Hypergeometric_fu[] = "hyp1f2(a, b, c, x)\n\nHypergeometric function 1F2 and error estimate\n\nReturns\n-------\ny\n    Value of the function\nerr\n    Error estimate";
static char __pyx_k_hyp2f0_a_b_x_type_Hypergeometric[] = "hyp2f0(a, b, x, type)\n\nHypergeometric function 2F0 in y and an error estimate\n\nThe parameter `type` determines a convergence factor and can be\neither 1 or 2.\n\nReturns\n-------\ny\n    Value of the function\nerr\n    Error estimate";
static char __pyx_k_hyp2f1_a_b_c_z_Gauss_hypergeomet[] = "hyp2f1(a, b, c, z)\n\nGauss hypergeometric function 2F1(a, b; c; z).";
static char __pyx_k_hyp3f0_a_b_c_x_Hypergeometric_fu[] = "hyp3f0(a, b, c, x)\n\nHypergeometric function 3F0 in y and an error estimate\n\nReturns\n-------\ny\n    Value of the function\nerr\n    Error estimate";
static char __pyx_k_hyperu_a_b_x_Confluent_hypergeom[] = "hyperu(a, b, x)\n\nConfluent hypergeometric function U(a, b, x) of the second kind";
static char __pyx_k_i0_x_Modified_Bessel_function_of[] = "i0(x)\n\nModified Bessel function of order 0.\n\nDefined as,\n\n.. math::\n    I_0(x) = \\sum_{k=0}^\\infty \\frac{(x^2/4)^k}{(k!)^2} = J_0(\\imath x),\n\nwhere :math:`J_0` is the Bessel function of the first kind of order 0.\n\nParameters\n----------\nx : array_like\n    Argument (float)\n\nReturns\n-------\nI : ndarray\n    Value of the modified Bessel function of order 0 at `x`.\n\nNotes\n-----\nThe range is partitioned into the two intervals [0, 8] and (8, infinity).\nChebyshev polynomial expansions are employed in each interval.\n\nThis function is a wrapper for the Cephes [1]_ routine `i0`.\n\nSee also\n--------\niv\ni0e\n\nReferences\n----------\n.. [1] Cephes Mathematical Functions Library,\n       http://www.netlib.org/cephes/index.html";
static char __pyx_k_i0e_x_Exponentially_scaled_modif[] = "i0e(x)\n\nExponentially scaled modified Bessel function of order 0.\n\nDefined as::\n\n    i0e(x) = exp(-abs(x)) * i0(x).\n\nParameters\n----------\nx : array_like\n    Argument (float)\n\nReturns\n-------\nI : ndarray\n    Value of the exponentially scaled modified Bessel function of order 0\n    at `x`.\n\nNotes\n-----\nThe range is partitioned into the two intervals [0, 8] and (8, infinity).\nChebyshev polynomial expansions are employed in each interval.  The\npolynomial expansions used are the same as those in `i0`, but\nthey are not multiplied by the dominant exponential factor.\n\nThis function is a wrapper for the Cephes [1]_ routine `i0e`.\n\nSee also\n--------\niv\ni0\n\nReferences\n----------\n.. [1] Cephes Mathematical Functions Library,\n       http://www.netlib.org/cephes/index.html";
static char __pyx_k_i1_x_Modified_Bessel_function_of[] = "i1(x)\n\nModified Bessel function of order 1.\n\nDefined as,\n\n.. math::\n    I_1(x) = \\frac{1}{2}x \\sum_{k=0}^\\infty \\frac{(x^2/4)^k}{k! (k + 1)!}\n           = -\\imath J_1(\\imath x),\n\nwhere :math:`J_1` is the Bessel function of the first kind of order 1.\n\nParameters\n----------\nx : array_like\n    Argument (float)\n\nReturns\n-------\nI : ndarray\n    Value of the modified Bessel function of order 1 at `x`.\n\nNotes\n-----\nThe range is partitioned into the two intervals [0, 8] and (8, infinity).\nChebyshev polynomial expansions are employed in each interval.\n\nThis function is a wrapper for the Cephes [1]_ routine `i1`.\n\nSee also\n--------\niv\ni1e\n\nReferences\n----------\n.. [1] Cephes Mathematical Functions Library,\n       http://www.netlib.org/cephes/index.html";
static char __pyx_k_i1e_x_Exponentially_scaled_modif[] = "i1e(x)\n\nExponentially scaled modified Bessel function of order 1.\n\nDefined as::\n\n    i1e(x) = exp(-abs(x)) * i1(x)\n\nParameters\n----------\nx : array_like\n    Argument (float)\n\nReturns\n-------\nI : ndarray\n    Value of the exponentially scaled modified Bessel function of order 1\n    at `x`.\n\nNotes\n-----\nThe range is partitioned into the two intervals [0, 8] and (8, infinity).\nChebyshev polynomial expansions are employed in each interval. The\npolynomial expansions used are the same as those in `i1`, but\nthey are not multiplied by the dominant exponential factor.\n\nThis function is a wrapper for the Cephes [1]_ routine `i1e`.\n\nSee also\n--------\niv\ni1\n\nReferences\n----------\n.. [1] Cephes Mathematical Functions Library,\n       http://www.netlib.org/cephes/index.html";
static char __pyx_k_inv_boxcox1p_y_lmbda_Compute_the[] = "inv_boxcox1p(y, lmbda)\n\nCompute the inverse of the Box-Cox transformation.\n\nFind ``x`` such that::\n\n    y = ((1+x)**lmbda - 1) / lmbda  if lmbda != 0\n        log(1+x)                    if lmbda == 0\n\nParameters\n----------\ny : array_like\n    Data to be transformed.\nlmbda : array_like\n    Power parameter of the Box-Cox transform.\n\nReturns\n-------\nx : array\n    Transformed data.\n\nNotes\n-----\n\n.. versionadded:: 0.16.0\n\nExamples\n--------\n>>> from scipy.special import boxcox1p, inv_boxcox1p\n>>> y = boxcox1p([1, 4, 10], 2.5)\n>>> inv_boxcox1p(y, 2.5)\narray([1., 4., 10.])";
static char __pyx_k_inv_boxcox_y_lmbda_Compute_the_i[] = "inv_boxcox(y, lmbda)\n\nCompute the inverse of the Box-Cox transformation.\n\nFind ``x`` such that::\n\n    y = (x**lmbda - 1) / lmbda  if lmbda != 0\n        log(x)                  if lmbda == 0\n\nParameters\n----------\ny : array_like\n    Data to be transformed.\nlmbda : array_like\n    Power parameter of the Box-Cox transform.\n\nReturns\n-------\nx : array\n    Transformed data.\n\nNotes\n-----\n\n.. versionadded:: 0.16.0\n\nExamples\n--------\n>>> from scipy.special import boxcox, inv_boxcox\n>>> y = boxcox([1, 4, 10], 2.5)\n>>> inv_boxcox(y, 2.5)\narray([1., 4., 10.])";
static char __pyx_k_it2i0k0_x_Integrals_related_to_m[] = "it2i0k0(x)\n\nIntegrals related to modified Bessel functions of order 0\n\nReturns\n-------\nii0\n    ``integral((i0(t)-1)/t, t=0..x)``\nik0\n    ``int(k0(t)/t, t=x..inf)``";
static char __pyx_k_it2j0y0_x_Integrals_related_to_B[] = "it2j0y0(x)\n\nIntegrals related to Bessel functions of order 0\n\nReturns\n-------\nij0\n    ``integral((1-j0(t))/t, t=0..x)``\niy0\n    ``integral(y0(t)/t, t=x..inf)``";
static char __pyx_k_it2struve0_x_Integral_related_to[] = "it2struve0(x)\n\nIntegral related to the Struve function of order 0.\n\nReturns the integral,\n\n.. math::\n    \\int_x^\\infty \\frac{H_0(t)}{t}\\,dt\n\nwhere :math:`H_0` is the Struve function of order 0.\n\nParameters\n----------\nx : array_like\n    Lower limit of integration.\n\nReturns\n-------\nI : ndarray\n    The value of the integral.\n\nSee also\n--------\nstruve\n\nNotes\n-----\nWrapper for a Fortran routine created by Shanjie Zhang and Jianming\nJin [1]_.\n\nReferences\n----------\n.. [1] Zhang, Shanjie and Jin, Jianming. \"Computation of Special\n       Functions\", John Wiley and Sons, 1996.\n       http://jin.ece.illinois.edu/specfunc.html";
static char __pyx_k_itairy_x_Integrals_of_Airy_funct[] = "itairy(x)\n\nIntegrals of Airy functions\n\nCalculates the integrals of Airy functions from 0 to `x`.\n\nParameters\n----------\n\nx: array_like\n    Upper limit of integration (float).\n\nReturns\n-------\nApt\n    Integral of Ai(t) from 0 to x.\nBpt\n    Integral of Bi(t) from 0 to x.\nAnt\n    Integral of Ai(-t) from 0 to x.\nBnt\n    Integral of Bi(-t) from 0 to x.\n\nNotes\n-----\n\nWrapper for a Fortran routine created by Shanjie Zhang and Jianming\nJin [1]_.\n\nReferences\n----------\n\n.. [1] Zhang, Shanjie and Jin, Jianming. \"Computation of Special\n       Functions\", John Wiley and Sons, 1996.\n       http://jin.ece.illinois.edu/specfunc.html";
static char __pyx_k_iteration_failed_to_converge_g_g[] = "iteration failed to converge: %g + %gj";
static char __pyx_k_iti0k0_x_Integrals_of_modified_B[] = "iti0k0(x)\n\nIntegrals of modified Bessel functions of order 0\n\nReturns simple integrals from 0 to `x` of the zeroth order modified\nBessel functions `i0` and `k0`.\n\nReturns\n-------\nii0, ik0";
