static char __pyx_k_pdtr_k_m_Poisson_cumulative_dist[] = "pdtr(k, m)\n\nPoisson cumulative distribution function\n\nReturns the sum of the first `k` terms of the Poisson distribution:\nsum(exp(-m) * m**j / j!, j=0..k) = gammaincc( k+1, m).  Arguments\nmust both be positive and `k` an integer.";
static char __pyx_k_pdtrc_k_m_Poisson_survival_funct[] = "pdtrc(k, m)\n\nPoisson survival function\n\nReturns the sum of the terms from k+1 to infinity of the Poisson\ndistribution: sum(exp(-m) * m**j / j!, j=k+1..inf) = gammainc(\nk+1, m).  Arguments must both be positive and `k` an integer.";
static char __pyx_k_pdtri_k_y_Inverse_to_pdtr_vs_m_R[] = "pdtri(k, y)\n\nInverse to `pdtr` vs m\n\nReturns the Poisson variable `m` such that the sum from 0 to `k` of\nthe Poisson density is equal to the given probability `y`:\ncalculated by gammaincinv(k+1, y). `k` must be a nonnegative\ninteger and `y` between 0 and 1.";
static char __pyx_k_poch_z_m_Rising_factorial_z__m_T[] = "poch(z, m)\n\nRising factorial (z)_m\n\nThe Pochhammer symbol (rising factorial), is defined as::\n\n    (z)_m = gamma(z + m) / gamma(z)\n\nFor positive integer `m` it reads::\n\n    (z)_m = z * (z + 1) * ... * (z + m - 1)";
